import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import "./App.css";

const Room = () => {
  const location = useLocation();
  return (
    <div className="Room">
      <div className="header-box">
        <div className="header-text">
          {localStorage.getItem("conferenceName")}
        </div>
      </div>
      <div>{location}</div>
    </div>
  );
};

export default Room;
